export const cart = []


export function addToCart(product){
    if (product) {
        cart.push(product)
    }
}
export function removeFromCart(id){
    const index = cart.findIndex(item => item.id === id);
    if (index !== -1) {
        cart.splice(index, 1); // Remove the item from the array in place
    }

}
